export function DeleteProduct(id){
    fetch(`https://localhost:44317/api/EladoTermek/${id}`,{
        method: "DELETE",
        headers:{
            "Content-Type":"application/json"
        },
    })
    .then(response=>{
        if(response.ok){
            localStorage.removeItem(`termek${id}`)
        }
         return response.json()})
}
